create table CabinetPageTranslation
(
    TranslationID int auto_increment
        primary key,
    LangID        int          null,
    MetaData      varchar(255) null,
    Translation   text         null,
    constraint FK_CabinetPageTranslation_LangID
        foreign key (LangID) references LangList (LangID)
)
    collate = utf8_general_ci
    avg_row_length = 199;

');
